  \"2015-08-21T22:41:55.832713\",\n\t\"name\": \"master-veteran-index-mvi\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"As of June 28, 2010, the Master Veteran
  Index (MVI) database based on the enhanced Master Patient Index (MPI) is the authoritative
  identity service within the VA, establishing, maintaining and synchronizing identities
  for VA clients, Veterans and beneficiaries.  The MVI includes authoritative sources
  for health identity data and contains over 17 million patient entries populated
  from all VHA facilities nationwide.  The MVI provides the access point mechanism
  for linking patient's information to enable an enterprise-wide view of patient information,
  uniquely identifies all active patients who have been admitted, treated, or registered
  in any VHA facility, and assigns a unique identifier to the patient.  The MVI correlates
  a patient's identity across the enterprise, including all VistA systems and external
  systems, such as Department of Defense (DoD) and the Nationwide Health Information
  Network (NwHIN).  The MVI facilitates the sharing of health information, resulting
  in coordinated and integrated health care for Veterans.  New Information Technology
  systems must be interoperable with the MVI and legacy systems will establish integration
  by October 1, 2012.  The Healthcare Identity Management (HC IdM) Team within VHA's
  Data Quality Program is the steward of patient identity data, performing maintenance
  and support activities.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
